&quot;The princess and the frog&quot; este un musical si un film de familie ce consemneaza reintoarcerea la animatiile traditionale in format 2D, starnind deja o vie controversa legata de faptul ca eroina principala este prima printesa de culoare din istoria bogata a desenelor animate marca Walt Disney.



 Povestea se centreaza pe viata Tianei, o tanara al carei vis este sa deschida un restaurant, acest vis fiind initial al tatalui sau si frumoasa printesa de origine afro-americana, in varsta de 19 ani, care locuieste impreuna cu mama sa Eudora in luxosul Cartier Francez din New Orleans, in timpul asa-zisei Epoci a Jazz-ului.
